import ProfileText from './Components/ProfileText';
import ProjectText from './Components/ProjectText';
import FlashingKeys from './Components/FlashingKeys';

function ProfilePage(props) {
    <div id="main-div" ref={props.matter} onKeyDown={props.handleDown} onWheel={props.handleDown} tabIndex={0}>
      <FlashingKeys onChange={props.removeArrowKeys} />
      <ProfileText onChange={props.makeProfileEnter} onPositionChange={props.moveProfileText} />
      <ProjectText onPositionChange={props.handleProjectMove} />
    </div>
}

export default ProfilePage;
